resources.description:
Você pode ver todas os serviços e suas categorias criadas utilizando este endpoint.
Eles serão retornados cada um com, um identificador numérico, e com dois objtos, um do tipo serviço contendo o nome do serviço, e outro a categoria do serviço contendo o nome dessa categoria:

	[
		{
			"id": 1,
			"idServicos": {
				"id": 1,
				"nome": "Churrasqueiro"
			},
			"idCategoria": {
				"id": 1,
				"nome": "Eventos"
			}
		}
	]

Você pode ver todas os usuarios criados utilizando este endpoint.
Eles serão retornados no seguinte formato:


	[
		{
			"id": 1,
			"nome": "Primeiro Usario",
			"linkFoto": "LINK EXEMPLO"
		},
		{
			"id": 2,
			"nome": "Segundo Usario",
			"linkFoto": "lINK EXEMPLO"
		}
	]

Contendo uma lista em formato Json com os seus objetos sendo todos ususarios.

Este endpoint altera um usuario em especifico, sendo este endereço definido por um numero inserido no final do link (sendo este uma variável), podendo ser alterado da seguinte forma: http://localhost:8080/jachei/usuarios/alterar-usurario/{coloque-aqui-o-numero-refernte-ao-usuario-que-deseja-alterar}

Para tal alteração sera necessario enviar junto ao PUT request um Json obedecendo o seguinte formato:


	{
		"nome": "Nome exemplo",
		"linkFoto": "LINK EXEMPLPO"
	}

Caso obtenha sucesso em alterar o endereço, você recebera uma mensagem de "Alterrado...".
